-- EU Only 
drop table if exists jt.newusers_combined_users;
create table jt.newusers_combined_users as
select distinct a.application_id
     , a.global_user_id
from jt.newusers_newmetrics_sessions a
join (select distinct lower(applicationid) as application_id
           , lower(globaluserid) as global_user_id
      from authdb_is_users
      where isdisabled = 0) b
on a.application_id = b.application_id
and a.global_user_id = b.global_user_id
where a.sessionstartcnt > 0
union
select distinct a.application_id
     , b.global_user_id
from jt.newusers_oldmetrics_sessions a
join (select distinct lower(applicationid) as application_id
           , lower(globaluserid) as global_user_id
           , userid as user_id
      from authdb_is_users
      where isdisabled = 0) b
on a.application_id = b.application_id
and a.user_id = b.user_id
where a.sessionstartcnt > 0
union
select distinct a.application_id
     , b.global_user_id
from jt.newusers_histmetrics_sessions a
join (select distinct lower(applicationid) as application_id
           , lower(globaluserid) as global_user_id
           , userid as user_id
      from authdb_is_users
      where isdisabled = 0) b
on a.application_id = b.application_id
and a.user_id = b.user_id
where a.sessionstartcnt > 0
;

