select *
from jt.newusers_combined_users
where upper(application_id) = '8566BA08-F3D2-40EC-B548-3EEFC67824A0';


select count(distinct global_user_id)
from fact_sessions_live
where application_id = '8566ba08-f3d2-40ec-b548-3eefc67824a0';
-- 280

select count(distinct user_id)
from fact_sessions_new
where application_id = '8566ba08-f3d2-40ec-b548-3eefc67824a0';
-- 188


select count(distinct userid)
from jt.newusers_histmetrics_sessions
where lower(application_id) = '8566ba08-f3d2-40ec-b548-3eefc67824a0';
-- 0



select distinct a.application_id
     , b.user_id
from jt.newusers_newmetrics_sessions a
join (select distinct lower(applicationid) as application_id
           , lower(globaluserid) as global_user_id
           , userid as user_id
      from authdb_is_users
      where isdisabled = 0) b
on a.application_id = b.application_id
and a.global_user_id = b.global_user_id
where a.sessionstartcnt > 0
and a.application_id = '8566ba08-f3d2-40ec-b548-3eefc67824a0'
union
select distinct a.application_id
     , b.user_id
from jt.newusers_oldmetrics_sessions a
join (select distinct lower(applicationid) as application_id
           , lower(globaluserid) as global_user_id
           , userid as user_id
      from authdb_is_users
      where isdisabled = 0) b
on a.application_id = b.application_id
and a.user_id = b.user_id
where a.sessionstartcnt > 0
and a.application_id = '8566ba08-f3d2-40ec-b548-3eefc67824a0'
;

select *
from eventcube.eventcubesummary
where lower(applicationid) = '8566ba08-f3d2-40ec-b548-3eefc67824a0';


select min(start_date)
     , max(start_date)
from fact_sessions_new
where application_id = '8566ba08-f3d2-40ec-b548-3eefc67824a0'
and metrics_type_id = 1
and app_type_id = 4;


select *
from fact_sessions_new limit 10;

select src
     , apptypeid
     , min(startdate)
     , max(startdate)
     , count(distinct globaluserid)
from eventcube.sessions
where lower(applicationid) = '8566ba08-f3d2-40ec-b548-3eefc67824a0'
group by 1,2;

